     &   (2*(2*F1*m22*SB2*CKM(Ind2,gno2)*CKMC(Ind1,gno1)*
     &         Mf(bH,gno2)*Sub634(All4,Cha4,Ind1)*
     &         UASf(All4,Ind2,tH)*UCha(Cha5,2) + 
     &        F2*m2*(1/sqrt2*
     &            (S2B*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*MCha(Cha5)*
     &              Sub656(All4,Cha4,Ind2)*Sub713(All4,Cha5,Ind1))-
     &             2*m3*SB2*CKM(Ind2,gno2)*CKMC(Ind1,gno1)*
     &            Mf(bH,gno2)*Sub634(All4,Cha4,Ind1)*
     &            UASf(All4,Ind2,tH)*UCha(Cha5,2))))/(S2B*SB2)

	Sub735(All4,Cha4,Cha5,Ind1,Ind2) = 
     &   (2*sqrt2*(F1*MCha(Cha4)*Mf(bH,gno1)*Mf(bH,gno2)*
     &         Sub721(Cha4,Cha5)*UASf(All4,Ind1,tH)*
     &         UASfC(All4,Ind2,tH)*UCha(Cha5,2)*UChaC(Cha4,2)) + 
     &      CB2*Sub713(All4,Cha5,Ind1)*Sub717(Cha4,Cha5)*
     &       Sub734(All4,Cha4,Ind2))/CB2

	Sub736(All4,Cha4,Cha5,Ind1,Ind2) = 
     &   m2*Sub735(All4,Cha4,Cha5,Ind1,Ind2) + 
     &    2*Mf(bH,gno1)*Sub717(Cha4,Cha5)*Sub733(All4,Cha5,Ind1)*
     &     UASfC(All4,Ind2,tH)*UChaC(Cha4,2)

	Sub737(All4,Cha4,Cha5,Ind1,Ind2) = 
     &   Sub721(Cha4,Cha5)*Sub732(All4,Cha4,Cha5,Ind1,Ind2) + 
     &    CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &     Sub736(All4,Cha4,Cha5,Ind1,Ind2)

	Sub738(All4,Cha4,Cha5,Ind1,Ind2) = 
     &   decczero*(C0i36(Epsi(cc0),All4,Cha4,Cha5)*
     &       Sub727(All4,Cha4,Cha5,Ind1,Ind2) + 
     &      C0i36(Epsi(cc1),All4,Cha4,Cha5)*
     &       Sub731(All4,Cha4,Cha5,Ind1,Ind2) + 
     &      C0i36(Epsi(cc2),All4,Cha4,Cha5)*
     &       Sub737(All4,Cha4,Cha5,Ind1,Ind2))

	ENDLOOP(Ind2)
	ENDLOOP(Ind1)
	ENDLOOP(Cha5)
	ENDLOOP(Cha4)
	ENDLOOP(All4)

	LOOP(All4, 1,6,1)
	LOOP(All5, 1,6,1)
	LOOP(Cha4, 1,2,1)
	LOOP(Ind1, 1,3,1)
	LOOP(Ind2, 1,3,1)
	LOOP(Ind3, 1,3,1)
	LOOP(Ind4, 1,3,1)

	Sub657(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(CB2*F1*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &         Sub635(All5,Cha4,Ind1)*Sub655(All4,All5,Ind3,Ind4)*
     &         Sub656(All4,Cha4,Ind2) + 
     &        2*F2*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &         Mf(bH,gno2)*Sub652(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*UCha(Cha4,2)*
     &         UChaC(Cha4,2)))/S2B**2

	Sub668(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(CB2*F1*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &         Sub635(All5,Cha4,Ind1)*Sub656(All4,Cha4,Ind2)*
     &         Sub667(All4,All5,Ind3,Ind4) + 
     &        2*F2*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &         Mf(bH,gno2)*Sub664(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*UCha(Cha4,2)*
     &         UChaC(Cha4,2)))/S2B**2

	Sub669(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   Sub657(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,1,uzext1) - 
     &    Sub668(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,2,uzext1)

	Sub674(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   -(4*cI*(3*CB2*F1*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &          Sub635(All5,Cha4,Ind1)*Sub656(All4,Cha4,Ind2)*
     &          Sub673(All4,All5,Ind3,Ind4) + 
     &         6*F2*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &          Mf(bH,gno2)*Sub670(All4,All5,Ind1,Ind2)*
     &          UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*
     &          UCha(Cha4,2)*UChaC(Cha4,2))/S2B**2)

	Sub675(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (TB*Sub669(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) + 
     &      CW*SB*Sub674(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &       XHiggs(hno,3,uzext1))/(CW*SB*TB)

	Sub676(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(CB2*F2*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &         Sub635(All5,Cha4,Ind1)*Sub655(All4,All5,Ind3,Ind4)*
     &         Sub656(All4,Cha4,Ind2) + 
     &        2*F1*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &         Mf(bH,gno2)*Sub652(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*UCha(Cha4,2)*
     &         UChaC(Cha4,2)))/S2B**2

	Sub677(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(CB2*F2*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &         Sub635(All5,Cha4,Ind1)*Sub656(All4,Cha4,Ind2)*
     &         Sub667(All4,All5,Ind3,Ind4) + 
     &        2*F1*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &         Mf(bH,gno2)*Sub664(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*UCha(Cha4,2)*
     &         UChaC(Cha4,2)))/S2B**2

	Sub678(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   Sub676(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,1,uzext1) - 
     &    Sub677(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,2,uzext1)

	Sub679(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   -(4*cI*(3*CB2*F2*CKM(Ind1,gno2)*CKMC(Ind2,gno1)*
     &          Sub635(All5,Cha4,Ind1)*Sub656(All4,Cha4,Ind2)*
     &          Sub673(All4,All5,Ind3,Ind4) + 
     &         6*F1*SB2*CKM(Ind3,gno2)*CKMC(Ind4,gno1)*Mf(bH,gno1)*
     &          Mf(bH,gno2)*Sub670(All4,All5,Ind1,Ind2)*
     &          UASf(All5,Ind3,tH)*UASfC(All4,Ind4,tH)*
     &          UCha(Cha4,2)*UChaC(Cha4,2))/S2B**2)

	Sub680(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (TB*Sub678(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) + 
     &      CW*SB*Sub679(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &       XHiggs(hno,3,uzext1))/(CW*SB*TB)

	Sub681(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   decczero*(m3*C0i1(Epsi(cc2),All4,All5,Cha4)*
     &       Sub675(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) + 
     &      m2*C0i1(Epsi(cc1),All4,All5,Cha4)*
     &       Sub680(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4))

	ENDLOOP(Ind4)
	ENDLOOP(Ind3)
	ENDLOOP(Ind2)
	ENDLOOP(Ind1)
	ENDLOOP(Cha4)
	ENDLOOP(All5)
	ENDLOOP(All4)

	end

